    else if (i % 5 == 5) {
        evnt = 'Fog-Rain';
        values.image = "/Thingworx/MediaEntities/fog";
    }
    else {
        evnt = 'None';
    }
    values.events = evnt;
    var params = {
        values : values
    };

    var id = Things["WeatherDataTable"].AddOrUpdateDataTableEntry(params);
}

/**
*  Weather Data Example with Query parameter
*  'WeatherWeekDataTable' Data-Table initialization script
*
*  Fills the 'WeatherWeekDataTable' with example weather data.
*
*  Required inputs:
*  none
*
*  Required outputs:
*  Nothing
*/

// no return
Things["WeatherWeekDataTable"].EnableThing();
// no return
Things["WeatherWeekDataTable"].RestartThing();

var d1 = new Date("2019/01/01");
var d;
var startId = Things["WeatherWeekDataTable"].GetDataTableEntryCount();
var week = cntr = 1;
var day = 1000 * 60 * 60 * 24;

for(var i=1;i<=100;i++)
{
    var newId = startId + i;
    //values:INFOTABLE(Datashape: WeatherWeekDataShape)
    var values = Things["WeatherWeekDataTable"].CreateValues();
    values.id = newId;
    d = new Date(d1.getTime() + (day * i));
    values.date = d;
    values.max_temp = Math.floor((Math.random() * 100) + 1);
    values.min_temp = Math.floor((Math.random() * 100) + 1);
    values.cold = values.max_temp < 50 ? true : false;
    values.visibility = Math.floor((Math.random() * 100) + 1);
    values.wind = Math.floor((Math.random() * 100) + 1);
    values.precipitation = Math.floor((Math.random() * 100) + 1);
    var evnt = '';
    var rnd = Math.floor((Math.random() * 100) + 1);
    if(i % 5 == 0) {
        evnt = 'Cloudy';
        values.image = "/Thingworx/MediaEntities/cloudy";
    }
    else if(i % 5 == 1) {
        evnt = 'Rain';
        values.image = "/Thingworx/MediaEntities/rain";
    }
    else if (i % 5 == 2) {
        evnt = 'Fog';
        values.image = "/Thingworx/MediaEntities/fog";
    }
    else if (i % 5 == 3) {
        evnt = 'Sunny';
        values.image = "/Thingworx/MediaEntities/sunny";
    }
    else if (i % 5 == 4) {
        evnt = 'Snow';
        values.image = "/Thingworx/MediaEntities/snow";
    }
    else if (i % 5 == 5) {
        evnt = 'Fog-Rain';
        values.image = "/Thingworx/MediaEntities/fog";
    }
    else {
        evnt = 'None';
    }
    values.events = evnt;
    if (cntr >= 7 ) { 
        week++;
        cntr = 0;
    }    
    cntr++;
    values.week = week;

    var params = {
        values : values
    };

    var id = Things["WeatherWeekDataTable"].AddOrUpdateDataTableEntry(params);
}

